import React from 'react'
import { Badge } from 'react-bootstrap'

export function Bug () {
  return <Badge variant='info'>#Bug</Badge>
}

export function Web () {
  return <Badge variant='danger'>#web</Badge>
}

export function BackEnd () {
  return <Badge variant='info'>#Back-end</Badge>
}
